class Node:  
    def __init__(self, data):  
        self.data = data  
        self.next = None  

class CircularLinkedList:  
    def __init__(self):  
        self.head = None  

    def add_to_empty(self, data):  
        if self.head is not None:  
            return  
        new_node = Node(data)  
        self.head = new_node  
        new_node.next = self.head  

    def add_at_end(self, data):  
        if self.head is None:  
            return self.add_to_empty(data)  
        new_node = Node(data)  
        cur = self.head  
        while cur.next != self.head:  
            cur = cur.next  
        cur.next = new_node  
        new_node.next = self.head  

    def search(self, x):  
        if self.head is None:  
            return None  
        cur = self.head  
        while True:  
            if cur.data == x:  
                return cur  
            cur = cur.next  
            if cur == self.head:  
                return None  

    def display(self):  
        if self.head is None:  
            return None  
        cur = self.head  
        while True:  
            print(cur.data, end =' ')  
            cur = cur.next  
            if cur == self.head:  
                break 

