def kLengthApart(nums: List[int], k: int) -> bool:
    lastIdx = -1
    for i in range(len(nums)):
        if nums[i] == 1:
            if lastIdx != -1 and i - lastIdx - 1 < k:
                return False
            lastIdx = i
    return True

