def min_abs_difference(nums, goal):
    n = len(nums)
    best = abs(sum(nums) - goal)
    for i in range(1, 2**n):
        sub = [nums[j] for j in range(n) if (i & (1<<j))]
        diff = abs(sum(sub) - goal)
        if diff < best:
            best = diff
    return best

