class Solution:
    def minEatingSpeed(self, piles: List[int], h: int) -> int:
        def feasible(speed: int) -> bool:
            time = sum((pile - 1) // speed + 1 for pile in piles)
            return time <= h

        left, right = 1, max(piles)
        while left < right:
            mid = (left + right) // 2
            if feasible(mid):
                right = mid
            else:
                left = mid + 1
        return left

