class Solution:
    def printVertically(self, s: str) -> List[str]:
        words = s.split()
        max_len = max(len(word) for word in words)
        res = [' ' * len(words) for _ in range(max_len)]
        for i, word in enumerate(words):
            for j, c in enumerate(word):
                res[j] = res[j][:i] + c + res[j][i + 1:]
        return res

