def min_food_buckets(hamsters):
    n = len(hamsters)
    empty_indices = [i for i in range(n) if hamsters[i] == '.']
    food_buckets = 0
    for i in range(n):
        if hamsters[i] == 'H':
            left = i - 1
            right = i + 1
            while left >= 0 and hamsters[left] == '.':
                hamsters[left] = 'F'
                food_buckets += 1
                left -= 1
            while right < n and hamsters[right] == '.':
                hamsters[right] = 'F'
                food_buckets += 1
                right += 1
    for i in empty_indices:
        if hamsters[i] == '.':
            return -1
    return food_buckets - len(empty_indices)

