def remove_duplicates(s: str, k: int) -> str:
    stack = []
    for char in s:
        if not stack or stack[-1][0] != char:
            stack.append([char, 1])
        else:
            count = stack[-1][1] + 1
            if count == k:
                stack.pop()
            else:
                stack[-1][1] = count
    result = []
    for char, count in stack:
        result.append(char * count)
    return ''.join(result)

