def tree_sort(lst):
    class Node:
        def __init__(self, val=None):
            self.left = None
            self.right = None
            self.val = val

        def insert(self, val):
            if self.val is None:
                self.val = val
                return self
            if val < self.val:
                if self.left is None:
                    self.left = Node(val)
                    return self.left
                else:
                    return self.left.insert(val)
            else:
                if self.right is None:
                    self.right = Node(val)
                    return self.right
                else:
                    return self.right.insert(val)

        def inorder(self):
            if self.left is not None:
                yield from self.left.inorder()
            if self.val is not None:
                yield self.val
            if self.right is not None:
                yield from self.right.inorder()

    root = Node()
    for x in lst:
        root.insert(x)
    return list(root.inorder())

