        if currCell[0] == rows-1:
            currState = 1
            currCell = [rows-2, 1]
        else:
            currCell[0] += 1
            if currCell[1] == cols-1:
                currState = 2
                currCell = [0, cols-2]
            else:
                currCell[1] += 1
    for c in redCells:
        decodedText[currCell[0]*cols+currCell[1]] = c
        if currState == 1:
            if currCell[1] == cols-1:
                currState = 2
                currCell = [0, cols-2]
            else:
                currCell[0] -= 1
                currCell[1] += 1
        elif currState == 3:
            if currCell[1] == numEmpty:
                currState = 0
                currCell = [0, 0]
            else:
                currCell[0] += 1
                currCell[1] -= 1
        else:
            if currCell[0] == 0:
                currState = 3
                currCell = [1, cols-1]
            else:
                currCell[0] -= 1
                currCell[1] += 1
    for c in yellowCells:
        decodedText[currCell[0]*cols+currCell[1]] = c
        if currCell[0] == 0:
            currState = 3
            currCell = [1, cols-1]
        else:
            currCell[0] -= 1
            currCell[1] -= 1
    return ''.join(decodedText)

