def distribute(nums, quantity):
    total = sum(quantity)
    if total != len(nums):
        return False

    qty_dict = {}
    for q in quantity:
        if q not in qty_dict:
            qty_dict[q] = 1
        else:
            qty_dict[q] += 1

    for k,v in qty_dict.items():
        if k*v > len(nums):
            return False

    nums.sort(reverse=True)
    for q in quantity:
        for i in range(q):
            if nums[i] < 1:
                return False
            nums[i] -= 1

    return True

