def max_income(n, edges, amount):
    tree = [[] for _ in range(n)]
    for a, b in edges:
        tree[a].append(b)
        tree[b].append(a)

    def dfs(node, parent):
        if node == 0:
            return 0

        max_profit = amount[node]
        for child in tree[node]:
            if child != parent:
                profit = dfs(child, node)
                if profit >= 0:
                    max_profit += profit

        return max_profit

    return dfs(1, 0)

