def game_probability(n, k, maxPts):
    if n >= k:
        return 0
    total_outcomes = pow(maxPts, k)
    favorable_outcomes = 0
    for i in range(total_outcomes):
        score = 0
        for j in range(k):
            draw = random.randint(1, maxPts)
            score += draw
            if score >= k:
                break
        if score < n:
            favorable_outcomes += 1
    return favorable_outcomes / total_outcomes

