def sieve_of_eratosthenes(n):
    primes = [True for i in range(n+1)]
    p = 2

    while p**2<=n:
        if primes[p]:
            for i in range(p**2, n+1, p):
                primes[i] = False
        p += 1

    prime_nums = []
    for i in range(2, n+1):
        if primes[i]:
            prime_nums.append(i)
    return prime_nums

