class Solution:
    def minTime(self, n: int, edges: List[List[int]], hasApple: List[bool]) -> int:
        graph = defaultdict(list)
        for u, v in edges:
            graph[u].append(v)
            graph[v].append(u)

        def dfs(node, prev):
            cost = 0
            for nei in graph[node]:
                if nei == prev:
                    continue
                c = dfs(nei, node)
                if c or hasApple[nei]:
                    cost += c + 2
            return cost

        return max(0, dfs(0, -1) - 2)

