def reshape(mat, r, c):
    rows = len(mat)
    cols = len(mat[0])

    if rows * cols == r * c:
        flattened = [elem for row in mat for elem in row]
        reshaped = [flattened[i*c:(i+1)*c] for i in range(r)]
        return reshaped
    else:
        return mat

