def expressiveWords(S: str, words: List[str]) -> int:
    def decompose(S):
        decom = []
        i = 0
        while i < len(S):
            j = i
            while j < len(S) and S[j] == S[i]:
                j += 1
            decom.append((S[i], j-i))
            i = j
        return decom

    def compare(a, b):
        if len(a) != len(b):
            return False
        for i in range(len(a)):
            if a[i][0] != b[i][0]:
                return False
            if a[i][1] < 3 and a[i][1] != b[i][1] or a[i][1] < b[i][1]:
                return False
        return True

    S_decom = decompose(S)
    count = 0
    for w in words:
        w_decom = decompose(w)
        if compare(S_decom, w_decom):
            count += 1
    return count

