def numOfSubarrays(arr: List[int], k: int, threshold: int) -> int:
    target = k * threshold
    current_sum = sum(arr[:k])
    count = 1 if current_sum >= target else 0

    for i in range(k, len(arr)):
        current_sum = current_sum - arr[i-k] + arr[i]
        if current_sum >= target:
            count += 1

    return count

