                    for d in dirs:
                        new_i = i + d[0]
                        new_j = j + d[1]
                        if new_i < 0 or new_i >= m or new_j < 0 or new_j >= n:
                            res = (res + dp[i][j]) % MOD
                        else:
                            new_dp[new_i][new_j] = (new_dp[new_i][new_j] + dp[i][j]) % MOD
            dp = new_dp
        return res % MOD

