    if len(s) == 0:
        return 0
    left = 0
    right = 0
    ans = 1
    visited = set()
    while right < len(s):
        if s[right] not in visited:
            visited.add(s[right])
            right += 1
            ans = max(ans, len(visited))
        else:
            visited.remove(s[left])
