class Solution:
    def shipWithinDays(self, weights: List[int], days: int) -> int:
        left, right = max(weights), sum(weights)

        while left < right:
            mid = (left + right) // 2
            curr_weight = 0
            needed_days = 1

            for weight in weights:
                if curr_weight + weight > mid:
                    needed_days += 1
                    curr_weight = 0
                curr_weight += weight

            if needed_days <= days:
                right = mid
            else:
                left = mid + 1

        return left

