def remove_node(root):
    result = []

    def traverse(node):
        if node is None:
            return False

        left = traverse(node.left)
        right = traverse(node.right)

        if left or right:
            node.left = None
            node.right = None
            result.append(node)
            return True

        if node.val == 1:
            if node.left is not None:
                result.append(node.left)
            if node.right is not None:
                result.append(node.right)
            return True

        return False

    traverse(root)
    if root.val != 1:
        result.append(root)
    return result

