MOD = 10**9 + 7

def min_wasted_space(packages, boxes):
    packages.sort()
    ans = float('inf')
    for b in boxes:
        b.sort()
        if b[-1] < packages[-1]:
            continue
        i = 0
        cur = 0
        for box in b:
            if i == len(packages):
                break
            if box >= packages[i]:
                cur += box - packages[i]
                i += 1
        if i == len(packages):
            ans = min(ans, cur)

    return ans % MOD if ans != float('inf') else -1

