class Solution:
    def nthMagicalNumber(self, n: int, a: int, b: int) -> int:
        def gcd(x, y):
            if y == 0:
                return x
            return gcd(y, x % y)

        def lcm(x, y):
            return x * y // gcd(x, y)

        mod = 10 ** 9 + 7
        l = lcm(a, b)
        left, right = 1, 10 ** 15
        while left < right:
            mid = (left + right) // 2
            count = mid // a + mid // b - mid // l
            if count < n:
                left = mid + 1
            else:
                right = mid

        return left % mod

