def transitive_closure(graph):
    n = len(graph)
    closure = np.copy(graph)
    for k in range(n):
        for i in range(n):
            for j in range(n):
                closure[i][j] = closure[i][j] or (closure[i][k] and closure[k][j])
    return closure

