def minDays(tasks: List[int], space: int) -> int:
    intervals = defaultdict(int)
    max_frequency = 0

    for i in range(len(tasks)):
        if tasks[i] not in intervals or (i - intervals[tasks[i]] > space):
            intervals[tasks[i]] = i
        else:
            intervals[tasks[i]] = intervals[tasks[i]] + space + 1

        max_frequency = max(max_frequency, len(intervals))

    return len(tasks) + (max_frequency - 1) * (space + 1) if max_frequency > 0 else len(tasks)

