def countIdealArrays(n, maxValue):
    mod = 1000000007
    dp = [[0 for i in range(maxValue+1)] for j in range(n)]
    for j in range(1,maxValue+1):
        dp[0][j] = 1
    for i in range(1,n):
        for j in range(1,maxValue+1):
            for k in range(1,maxValue//j+1):
                dp[i][j*k] = (dp[i][j*k]+dp[i-1][j])%mod
    return sum(dp[n-1])%mod

