capacity = 50
value = 0
def fractional_knapsack(items, capacity):
    total_weight = 0
    for v, w in sorted(items, key=lambda i: -i[0]/i[1]):
        if total_weight + w <= capacity:
            value += v
            total_weight += w
        else:
            value += (capacity - total_weight) * (v / w)
