def numSubmatrixSumTarget(matrix: List[List[int]], target: int) -> int:
    n, m = len(matrix), len(matrix[0])
    for i in range(n):
        for j in range(1, m):
            matrix[i][j] += matrix[i][j-1]
    res = 0
    for i in range(m):
        for j in range(i, m):
            preSum = {0: 1}
            cur = 0
            for k in range(n):
                cur += matrix[k][j] - (matrix[k][i-1] if i > 0 else 0)
                res += preSum.get(cur - target, 0)
                preSum[cur] = preSum.get(cur, 0) + 1
    return res

