class Solution:
    def fourSumCount(self, nums1: List[int], nums2: List[int], nums3: List[int], nums4: List[int]) -> int:
        sums = {}
        count = 0
        for a in nums1:
            for b in nums2:
                if a + b in sums:
                    sums[a + b] += 1
                else:
                    sums[a + b] = 1

        for c in nums3:
            for d in nums4:
                if -c - d in sums:
                    count += sums[-c - d]

        return count

